class BaiduReportService extends CommonService implements ReportServiceIface
{
    public function __construct() {
        parent::__construct ( SearchType::BAIDU, 'ReportService' );

    }

    /**
     * @param GetReportRequest $getReportRequest
     * @return array
     */
    public function getReport($getReportRequest){
        $response = $this->execute ( 'getRealTimeData', $getReportRequest );
        $typeName = array('userName', 'campaignName', 'adgroupName', 'keyword');
        $type = $getReportRequest->getRealTimeRequestType();
        return $this->buildReport($response->data, $type->performanceData, $typeName, $type->device, $type->unitOfTime);
    }

    private function buildReport($data, $performanceData, $typeName, $device, $unitOfTime){
        $arr = array();
        foreach ($data as $d){
            $a['id'] = $d->id;

            foreach ($d->kpis as $key => $pki){
                $a[$performanceData[$key]] = $pki;
            }
            foreach ($d->name as $key => $name){
                $a[$typeName[$key]] = $name;
            }
            $a['date'] = $d->date;
            $a['device'] = (string)$device;
            $a['unitOfTime'] = (string)$unitOfTime;
            $arr[] = $a;
        }
        return $arr;
    }
    //获取百度账户报表数据
    public function getAccountReport($getReportRequest,$userId){
        $arr = array(
            'head'=>'',
            'reports'=>array()
        );
        $type = $getReportRequest->getRealTimeRequestType();
        $response = $this->execute ( 'getRealTimeData', $getReportRequest );

        $head = $this->getJsonHeader();

        $arr['head'] = $head;
        if(isset($head->desc) && $head->desc == 'success'){

            if(isset($response->data) && !empty($response->data)){
                $performanceData = $type->performanceData;
                $device = $type->device;
                $data = $response->data;

                foreach ($data as $d){
                    $a['userId'] = $userId;
                    $a['platform'] = SearchType::BAIDU;

                    foreach ($d->kpis as $key => $pki){
                        $a[$performanceData[$key]] = $pki;
                    }
                    unset($a['cpc']);
                    unset($a['ctr']);
                    foreach ($d->name as $key => $name){
                        $a['userName'] = $name;
                    }
                    $a['dateTime'] = $d->date;
                    $a['device'] = $device;
                    $a['unitOfTime'] = 5;
                    $arr['reports'][] = $a;
                }
            }else{
                echo "平台:".SearchType::BAIDU.",用户id:".$userId.",用户名:".$this->authHeader->username.",设备:".$type->getDevice().",日期:".$type->startDate."报表api未返回报表数据\n";
            }
        }else{
            echo "平台:".SearchType::BAIDU.",用户id:".$userId.",用户名:".$this->authHeader->username.",设备:".$type->getDevice().",日期:".$type->startDate."报表api调用出错\n";
        }
        return $arr;

    }

    public function getJsonHeader(){
        $head = parent::getJsonHeader();
        $head->resultCode = !empty($head->failures[0]->code)?$head->failures[0]->code:'';
        $head->rsMsg = !empty($head->failures[0]->code)?$this->msgOfCode($head->failures[0]->code):'';
        return $head;
    }
    //获取状态码对应的message
    private function msgOfCode($code){
        $arr = SearchType::getBAIDUMsgDic();
        return !empty($arr[$code])?$arr[$code]:'';
    }

}
